import './App.css';
import HomePage from './components/HomePage';
import Quiz from './components/Quiz';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>

          <Route path='/quiz'>
            <Quiz />
            </Route>

          <Route path='/'>
            <HomePage />
            </Route>

        </Switch>
      </Router>

    </div>
  );
}

export default App;
